using AdventOfCode.Year2023;

namespace AdventOfCodeTests.Year2023
{
    public class Day07Tests
    {
        [Test]
        public void CamelPoker_CanReadInput()
        {
            var camelPoker = new CamelPoker(exampleInput);

            camelPoker.Hands.Should().BeEquivalentTo(new List<CamelPokerHand>
            {
                new CamelPokerHand("QQQJA", 483),
                new CamelPokerHand("KK677", 28),
                new CamelPokerHand("KTJJT", 220),
                new CamelPokerHand("T55J5", 684),
                new CamelPokerHand("32T3K", 765)
            });
        }

        [TestCase("QQQJA", "T55J5")]
        [TestCase("T55J5", "KK677")]
        [TestCase("KK677", "KTJJT")]
        [TestCase("KTJJT", "32T3K")]
        public void CamelPoker_CanCompareHands(string bigger, string smaller)
        {
            new CamelPokerHand(bigger, 0).Should().BeGreaterThan(new CamelPokerHand(smaller, 0));
        }

        [Test]
        public void CamelPoker_CanGetExamplePuzzleResult()
        {
            var camelPoker = new CamelPoker("32T3K 765\r\nT55J5 684\r\nKK677 28\r\nKTJJT 220\r\nQQQJA 483");

            camelPoker.GetWinnings().Should().Be(6440);
        }

        [Test]
        public void CamelPoker_CanGetPart1()
        {
            var camelPoker = new CamelPoker(inputPart);

            camelPoker.GetWinnings().Should().Be(246912307L);
        }

        [TestCase("KTJJT", "QQQJA")]
        [TestCase("QQQJA", "T55J5")]
        [TestCase("T55J5", "KK677")]
        [TestCase("KK677", "32T3K")]
        public void CamelPoker_CanCompareHandsWithJokers(string bigger, string smaller)
        {
            new CamelPokerHand(bigger, 0, jokers: true).Should().BeGreaterThan(new CamelPokerHand(smaller, 0, jokers: true));
        }

        [TestCase("32T3K", CamelPokerHandType.OnePair)]
        [TestCase("KK677", CamelPokerHandType.TwoPair)]
        [TestCase("T55J5", CamelPokerHandType.FourOfAKind)]
        [TestCase("KTJJT", CamelPokerHandType.FourOfAKind)]
        [TestCase("QQQJA", CamelPokerHandType.FourOfAKind)]
        [TestCase("2345J", CamelPokerHandType.OnePair)]
        [TestCase("234JJ", CamelPokerHandType.ThreeOfAKind)]
        [TestCase("224JJ", CamelPokerHandType.FourOfAKind)]
        [TestCase("2244J", CamelPokerHandType.FullHouse)]
        [TestCase("JJJJJ", CamelPokerHandType.FiveOfAKind)]
        public void CamelPoker_CanCalculateHandType_GivenJokers(string cards, CamelPokerHandType type)
        {
            new CamelPokerHand(cards, 0, jokers: true).HandType.Should().Be(type);
        }

